sources.scss\\variables.scss:
$yellow: #FFED00;
$green: #40C700;
$soft-black: #2B2A29;
$red: #ED1C24;

//--------DEVICE SIZE--------
$small-mobile: 400px;
$tablet-width: 648px;
$desktop-width: 1023px;
$container-width: 1200px;

@mixin small-mobile {
  @media (max-width: $small-mobile) {
    @content;
  }
}

@mixin mobile {
  @media (max-width: #{$tablet-width - 1px}) {
    @content;
  }
}

@mixin tablet {
  @media (max-width: #{$desktop-width}) {
    @content;
  }
}


@mixin desktop {
  @media (min-width: #{$desktop-width + 1px}) {
    @content;
  }
}

@mixin container {
  @media (min-width: #{$desktop-width}) and (max-width: #{$container-width}) {
    @content;
  }
}

sources.main.scss:
@import 'scss/reset.scss';
@import 'scss/variables.scss';
@import 'scss/select2.min.scss';

html {
    font-size: 15px;
    color: $soft-black;

    @include container {
        font-size: 14px;
    }
}

body {
    font-family: 'Montserrat', sans-serif;
    overflow-x: hidden;
}
.container {
    max-width: 1150px;
    display: block;
    margin: auto;

    @include container {
        padding-left: 25px;
        padding-right: 25px;
    }
}

@import 'scss/button.scss';
@import 'scss/header.scss';
@import 'scss/menu.scss';
@import 'scss/footer.scss';
@import 'scss/subtitle.scss';
@import 'scss/welcome.scss';
@import 'scss/categories.scss';
@import 'scss/markets.scss';
@import 'scss/services.scss';
@import 'scss/about.scss';

sources.scss\\button.scss:
.button {
    color: #FFFFFF;
    font: inherit;
    font-weight: bold;
    font-size: 13px;
    line-height: 25px;
    text-align: center;
    padding: 7px 22px;
    border: 0;
    background-color: $green;
    position: relative;
    cursor: pointer;
    border-radius: 20px;
    box-shadow: 0px 2px 20px rgba(0, 0, 0, 0.075);
    transition: all ease-out .2s;
    
    &:hover {
        box-shadow: 0px 2px 20px rgba(0, 0, 0, 0.281);
    }

    &_yellow {
        background-color: $yellow;
        color: $soft-black;
    }
}

sources.scss\\header.scss:
.header {
    padding-top: 10px;
    position: relative;

    .container {
        display: flex;
        justify-content: space-between;
        align-items: stretch;
    }

    &:before {
        content: '';
        background: $yellow;
        top: 0;
        left: 40px;
        width: 130vw;
        height: 1100px;
        transform: rotate(-7deg) translateY(-50%);
        border-bottom-left-radius: 100px;
        position: absolute;
        z-index: -1;
    }

    &__hot {
        display: flex;
        align-items: flex-end;

        b {
            font-weight: bold;
            padding: 0px 9px 2px;
        }
    }

    &__logo {
        display: block;
        margin-top: 28px;
    }
    
    &__middle {
        flex: auto;
        padding-left: 57px;
        margin-bottom: 10px;
        align-self: flex-end;
        position: relative;
    
        &:before {
            content: '';
            display: block;
            border: 42px solid transparent;
            border-left: 130vw solid #FFF;
            left: 50%;
            top: 50%;
            transform: translate(-50%, -50%);
            z-index: -1;
            position: absolute;
        }
    }
    
    &__right {
        display: flex;
        flex-direction: column;
        align-items: center;
        padding-top: 5px;
    }

    &__link {
        text-decoration: none;
        color: inherit;
    }

    &__tel {
        font-weight: bold;
        font-size: 20px;
        line-height: 20px;
    }

    &__mail {
        font-weight: 300;
        font-size: 16px;
        line-height: 25px;
    }

    &__callback {
        margin-top: 7px;
    }
}

sources.scss\\menu.scss:
.menu {
    color: $soft-black;
    display: flex;
    font-weight: normal;
    font-size: 12px;
    line-height: 25px;

    &__item {
        margin-right: 35px;
        list-style: none;
        transition: ease-out .12s;

        &:hover {
            transform: scale(1.3);
        }
        &:last-child {
            margin-right: 0;
        }

        a {
            text-decoration: none;
            color: inherit;
        }
    }
}

sources.scss\\footer.scss:
.footer {
    padding-top: 128px;
    padding-bottom: 122px;
    position: relative;
    overflow: hidden;

    &:before {
        content: "";
        background: #2B2A29;
        top: 0;
        right: 30px;
        width: 130vw;
        height: 700px;
        transform: rotate(-7deg) translateY(27%);
        border-radius: 100px;
        position: absolute;
        z-index: -1;
    }

    .container {
        border-bottom: 1px solid #fff;
        padding-bottom: 27px;
        display: flex;
        align-items: flex-end;
    }

    &__left {
        width: 50%;
        max-width: 561px;
    }

    &__info {
        box-shadow: -4px -4px 15px rgba(0, 0, 0, 0.25);
        border-radius: 50px;
        overflow: hidden;
    }

    &__info-top {
        padding: 35px 39px 24px;
        background-color: #fff;
        display: flex;
        justify-content: space-between;
    }

    &__info-links {
        display: inline-flex;
        flex-direction: column;
        align-items: center;
    }

    &__info-link {
        display: block;
        text-decoration: none;
        color: inherit;
    }

    &__info-tel {
        font-weight: bold;
        font-size: 20px;
        line-height: 20px;
    }

    &__info-mail {
        font-weight: 300;
        font-size: 16px;
        line-height: 25px;
    }

    &__info-bottom {
        background-color: $yellow;
        padding: 27px 19px;
        text-align: center;
        font-size: 17px;

        b {
            font-weight: bold;
        }
    }

    &__mailing {
        margin-top: 37px;
        display: flex;
        justify-content: space-between;
        align-items: center;
    }

    &__subscribe {
        display: flex;
        align-items: center;
        margin-left: 30px;
        flex: 1;
        position: relative;
    }

    &__subscribe-txt {
        font-weight: bold;
        font-size: 20px;
        line-height: 20px;
        max-width: 180px;
        color: #fff;
    }

    &__subscribe-field-wrap {
        display: flex;
        align-items: center;
        width: 100%;
    }

    &__subscribe-field {
        background: #FFFFFF;
        border: 1px solid rgba(34, 34, 34, 0.25);
        box-shadow: 0px 20px 30px rgba(34, 34, 34, 0.07);
        border-radius: 50px;
        font: inherit;
        font-size: 12px;
        line-height: 12px;
        padding: 15px 50px 15px 15px;
        margin-left: 15px;
        flex: 1;

        &::placeholder {
            color: rgba(34, 34, 34, 0.2);
        }
    }

    &__subscribe-btn {
        border-radius: 50%;
        height: 40px;
        width: 40px;
        display: flex;
        align-items: center;
        justify-content: center;
        border: 0;
        background-color: $green;
        position: absolute;
        top: 50%;
        right: 4px;
        transform: translateY(-50%);
        transition: ease-in-out .18s;

        &:hover {
            background-color: darken($green, 10%);
        }
    }

    &__right {
        flex: 1;
        display: flex;
        justify-content: space-around;
        padding-bottom: 25px;
    }

    &__subtitle {
        font-weight: bold;
        font-size: 20px;
        line-height: 20px;
        color: #fff;
    }

    &__menu {
        ul {
            margin-top: 22px;
        }

        a {
            text-decoration: none;
            color: #fff;
        }
    }

    &__menu-item {
        font-size: 12px;

        &:before {
            content: url("data:image/svg+xml,%3Csvg width='7' height='7' viewBox='0 0 7 7' fill='none' xmlns='http://www.w3.org/2000/svg'%3E%3Ccircle cx='4.5' cy='4.5' r='2.5' fill='%23FFED00'/%3E%3Ccircle cx='2.5' cy='2.5' r='2.5' fill='white'/%3E%3C/svg%3E%0A");
            margin-right: 5px;
        }

        &+.footer__menu-item {
            margin-top: 24px;
        }
    }

    &__contacts {
        ul {
            margin-top: 22px;
        }
    }

    &__contacts-item {
        display: flex;
        align-items: center;

        &+.footer__contacts-item {
            margin-top: 9px;
        }

        img {
            margin-right: 10px;
        }

        a {
            font-weight: bold;
            font-size: 15px;
            line-height: 20px;
            color: $yellow;
            text-decoration: none;
        }
    }

    &__apps {
        display: inline-flex;
        flex-direction: column;
        align-items: flex-start;
        margin-top: 10px;
        position: relative;
    }

    &__apps-soon {
        font-weight: bold;
        font-size: 20px;
        line-height: 20px;
        background: rgba(255, 237, 0, 0.9);
        border-radius: 10px;
        padding: 15px;
        position: absolute;
        top: 50%;
        left: 50%;
        transform: translate(-50%, -50%);
    }

    &__app-icon {
        &:last-of-type {
            margin-top: 5px;
        }
    }
}

sources.scss\\subtitle.scss:
.subtitle {
    text-align: center;
    padding: 25px 0;

    &__title {
        font-size: 30px;
        line-height: 34px;
    }

    &__txt {
        display: block;
        font-size: 15px;
        line-height: 23px;
        padding-top: 20px;
    }

    // mods
