        background: $yellow;
    }
}

sources.scss\\welcome.scss:
$txt-offset: 20px;

.welcome {
    margin-top: 50px;
    display: flex;
    justify-content: space-between;

    &__instruments {
        margin-left: 26px;
        transition: ease-out .2s;

        &:hover {
            filter: drop-shadow(2px 4px 6px rgba(0, 0, 0, 0.205));
        }
    }

    &__title {
        font-weight: 600;
        font-size: 3.4rem;
        line-height: 64px;
        padding-top: 10px;
    }

    &__sales {
        display: block;
        font-weight: 400;
        padding-left: 70px;
        margin-top: 20px;
        display: block;
    }

    &__percent {
        font-weight: bold;
        position: relative;

        &:after {
            content: '\204e';
            position: absolute;
            top: -46%;
            left: 95%;
            font-size: 20px;
            font-family: Tahoma;
            font-style: italic;
        }

        &_double {
            &:after {
                content: '\204e\204e';

            }
        }
    }

    &__title-bottom {
        font-weight: normal;
        font-size: 20px;
        line-height: 24px;
        padding-left: $txt-offset;
    }

    &__footer-txt {
        padding-left: $txt-offset;
        margin-top: 15px;
        margin-bottom: 4px;
        font-size: 16px;
        line-height: 19px;
    }

    &__txt-info {
        font-style: italic;
        font-size: 12px;
        line-height: 19px;
        padding-left: 10px;
    }

    &__discount {
        padding: 15px 23px;
        border-radius: 0px 50px;
        background: #C8281C;
        color: #FFF;
        display: inline-flex;
        flex-direction: column;
        position: relative;
        margin-left: $txt-offset;
        margin-bottom: 12px;
    }

    &__discount-title {
        font-weight: bold;
        font-size: 38px;
    }

    &__discount-txt {
        font-weight: normal;
        font-size: 22px;
        line-height: 20px;
        margin-top: 4px;
        display: flex;
        align-items: flex-start;
    }

    &__discount-bold-txt {
        font-size: 35px;
        line-height: 24px;
        color: $yellow;
        margin-left: 9px;
    }

    &__discount-btn {
        position: absolute;
        right: -60px;
        bottom: 0;
        transform: translateY(50%);
    }
}

.search {
    display: flex;
    align-items: stretch;
    justify-content: space-between;
    margin-top: 36px;
    padding: 0px 5px 0 $txt-offset;

    .select2-selection--single {
        display: flex;
        align-items: center;
        padding: 21px 10px;
        font-size: 14px;
        line-height: 14px;
        color: #000;
        min-width: 175px;
        position: relative;

        &::before {
            content: url("data:image/svg+xml,%3Csvg width='12' height='12' viewBox='0 0 12 12' fill='none' xmlns='http://www.w3.org/2000/svg'%3E%3Cpath d='M11.764 0.0451624C11.6432 -0.0153796 11.5009 -0.0153796 11.3801 0.0451624L0.237581 5.61641C0.0259223 5.72235 -0.0597807 5.97979 0.0461365 6.19145C0.106427 6.31193 0.219878 6.39705 0.352412 6.42123L4.77469 7.22563L5.57909 11.6479C5.61201 11.8292 5.75715 11.9692 5.9395 11.9955C5.95967 11.9984 5.98001 11.9998 6.00035 11.9998C6.16279 11.9998 6.31129 11.9081 6.38391 11.7628L11.9552 0.620274C12.0612 0.408666 11.9756 0.15118 11.764 0.0451624Z' fill='black'/%3E%3C/svg%3E%0A");
        }
    }

    .select2-selection__arrow {
        height: 100%;
    }

    &__field {
        flex: 1;
        margin: 0px 10px;
        padding: 18px;
        border: 0;
        border-radius: 4px;
        font: inherit;
        transition: all ease-out 0.15s;

        &::placeholder {
            font-weight: 300;
            font-size: 14px;
            line-height: 14px;
            color: #7E7E7E;
        }

        &:hover,
        &:focus {
            box-shadow: 0 0 5px 1px #98989857;
        }
    }

    &__find {
        border: 0;
        display: flex;
        align-items: center;
        justify-content: center;
        box-shadow: 0px 6px 6px rgba(255, 128, 24, 0.41);
        border-radius: 4px;
        width: 113px;
    }
}

sources.scss\\categories.scss:
.categories-block {
    margin-top: 104px;

    &__grid {
        display: grid;
        grid-template-columns: repeat(3, 1fr);
        grid-gap: 5px 20px;
        margin-top: 16px;

        &_short {
            .categories-block__grid-item:nth-of-type(n+10){
                display: none;
            }
        }
    }

    &__cat-name {
        display: flex;
        align-items: center;
    }

    &__cat-icon {
        width: 100px;
        min-width: 100px;
        height: 100px;
        background-color: $yellow;
        border-radius: 50%;
        position: relative;
        z-index: 1;

        img {
            position: absolute;
            top: 50%;
            left: 50%;
            transform: translate(-50%, -50%);
            height: 65%;
            width: 65%;
            object-position: center;
            object-fit: contain;
        }
    }

    &__cat-title {
        display: inline-flex;
        margin-left: -20px;
        color: #FFF;
        text-decoration: none;
        position: relative;
        z-index: -1;
        max-width: 70%;

        h2 {
            background-color: $soft-black;
            font-size: 15px;
            line-height: 20px;
            font-weight: 300;
            display: inline;
            padding: 6px 17px 9px 47px;

            @include container {
                padding: 6px 17px 9px 31px;
            }
        }

        &:after {
            content: '';
            display: block;
            height: 100%;
            transform: skewX(-20deg);
            background-color: $soft-black;
            width: 38px;
            border-radius: 7px;
            position: absolute;
            right: -20px;
            top: 0;
        }

        &_reverse:after {
            transform: skewX(20deg);
        }
    }

    &__subcats-list-wrap {
        padding-left: 35%;
        margin-top: -15px;

        @include container {
            margin-top: -5px;
        }
    }

    &__subcats-list {
        &_short {
            .categories-block__subcat:nth-of-type(n+4) {
                display: none;
            }
        }
    }

    &__subcat {
        font-weight: 300;
        font-size: 15px;
        line-height: 15px;
        margin-bottom: 5px;
        display: flex;
        align-items: flex-start;

        &:before {
            content: url("data:image/svg+xml,%3Csvg width='7' height='7' viewBox='0 0 7 7' fill='none' xmlns='http://www.w3.org/2000/svg'%3E%3Ccircle cx='4.5' cy='4.5' r='2.5' fill='%23FFED00'/%3E%3Ccircle cx='2.5' cy='2.5' r='2.5' fill='%232B2A29'/%3E%3C/svg%3E%0A");
            margin-right: 4px;
            margin-top: -2px;
        }

        a {
            text-decoration: none;
            color: inherit;
        }
    }

    &__show-all {
        border: 0;
        padding: 0;
        background: transparent;
        font: inherit;
        font-weight: 500;
        font-size: 15px;
        line-height: 15px;
        display: flex;

        &:before {
            content: url("data:image/svg+xml,%3Csvg width='9' height='6' viewBox='0 0 9 6' fill='none' xmlns='http://www.w3.org/2000/svg'%3E%3Cpath fill-rule='evenodd' clip-rule='evenodd' d='M3.99994 5L-7.54769e-05 1.00001L0.707031 0.292908L4.49994 4.5L3.99994 5Z' fill='%232B2A29'/%3E%3Cpath fill-rule='evenodd' clip-rule='evenodd' d='M8.2425 0.999958L3.99985 4.99997L3.49988 4.5L7.5354 0.292851L8.2425 0.999958Z' fill='%232B2A29'/%3E%3C/svg%3E%0A");
            margin-right: 3px;
            margin-top: -1px;
            transition: ease-out 0.12s;
        }

        &.active:before {
            transform: scaleY(-1);
            margin-top: 3px;
        }
    }

    &__more {
        margin: 48px auto 0;
        display: block;

        &.active{
            background-color: $red;
        }
    }
}

sources.scss\\markets.scss:
.markets-block {
    margin-top: 72px;

    &__grid {
        margin-top: 73px;
        display: grid;
        grid-template-columns: repeat(4, 1fr);
        justify-content: space-between;
        grid-gap: 45px 40px;
    }

    &__item {
        position: relative;
        width: 40%;
        padding-bottom: 40%;
        border-radius: 50%;
        background-color: $yellow;

        &:hover {
            .markets-block__icon {
                margin-left: -5px;
            }
        }
    }

    &__percent {
        font-weight: 800;
        font-size: 16px;
        line-height: 19px;
        color: #fff;
        width: 38px;
        height: 38px;
        text-align: center;
        display: flex;
        align-items: center;
        justify-content: center;
        background-color: $soft-black;
        border-radius: 50%;
        position: absolute;
        top: -5px;
        left: -5px;

        &_red {
            background-color: $red;
        }
    }

    &__icon {
        position: absolute;
        bottom: 50%;
        left: 35%;
        transform: translateY(50%);
        max-width: 180%;
        transition: ease-out .18s;
    }

    &__more {
        margin: 64px auto 0;
        display: block;
    }
}

sources.scss\\services.scss:
.services-block {
    margin-top: 57px;

    &__grid {
        display: grid;
        grid-template-columns: repeat(auto-fit, minmax(290px, 1fr));
        grid-gap: 49px 39px;
        margin-top: 59px;
    }

    &__item {
        background-color: rgba(0, 0, 0, 0.8);
        background-size: cover;
        min-height: 205px;
        border-radius: 20px 0;
        display: flex;
        flex-direction: column;
        justify-content: space-between;
        color: inherit;
        text-decoration: none;

        @for $i from 1 through 6 {
            $delay: random(5) + random(100)/100 + s;
            &:nth-of-type(#{$i}) .services-block__percent{
                animation: pulse 8s $delay ease-in-out infinite;
            }
        }
    }

    &__subtitle {
        background: rgba(0, 0, 0, 0.8);
        text-align: center;
        padding: 3px 15px;
        font-weight: 300;
        font-size: 30px;
        line-height: 34px;
        color: #fff;
        border-radius: 20px 0 0 0;
        text-transform: uppercase;
    }

    &__discount {
        display: flex;
        align-items: center;
        justify-content: space-between;
        padding: 5px 12px;
        font-weight: normal;
        font-size: 14px;
        text-align: center;
        color: #fff;
        background: rgba(0, 0, 0, 0.8);
        border-radius: 0 0 20px 0;

        span {
            z-index: 1;
            position: relative;
        }
    }

    &__percent {
        font-weight: 800;
        font-size: 37px;
        line-height: 34px;
        color: $red;
        position: relative;

        &:before {
            content: '';
            position: absolute;
            height: 74px;
            width: 74px;
            background-color: $yellow;
            left: -28px;
            transform: translateY(50%);
            bottom: 50%;
            border-radius: 50%;
        }
    }

    &__actions {
        margin-top: 67px;
        display: flex;
        justify-content: center;
    }

    &__btn {
        min-width: 188px;

        & + .services-block__btn {
            margin-left: 14px;
        }
    }
}


@keyframes pulse {

    0%,
    20%,
    40% {
        transform: scale(1);
    }

    10%,
    30% {
        transform: scale(1.1);
    }
}

